name: Thaumatin data from Diamond Light Source I04 user training
author: Winter, Graeme; Hall, David (2014)
license: CC-0
url: https://doi.org/10.5281/zenodo.10271
description: >
  Data recorded on Diamond Beamline I04 as part of user training
  (block allocation group training; 2013-07-03) from thaumatin
  crystal prepared following standard methods. Data collection
  strategy based on recording three images and running EDNA MXv1,
  parameters recorded in the image header.

